(140, 1, '2019-03-14 00:32:57', '2019-03-14 00:32:57', '<span style=\"line-height: 1.5em;\">El equipo TSTED creará un Fundpage del cliente enfocado solo en su local comercial. Esto, según los requerimientos de diseño definidos por TSTED .</span>\n\nSe instalará solo una pantalla Tsted en la fachada del local comercial, junto con un afiche personalizado que oriente al cliente para buscar y poner me gusta según la experiencia que haya tenido en el local.\n\nLa duración del contrato Servicio Básico es de 1 año. Y su costo mensual corresponde a 1 UTM.', 'Servicio Bronze', '- Creación fundpage personalizado.\r\n- Instalación contador TSTED.', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2019-03-14 00:32:57', '2019-03-14 00:32:57', '', 20, 'http://gabriela.freshwork.cl/20-revision-v1/', 0, 'revision', '', 0),
